import Handsontable from "handsontable";
import { HotTable, HotColumn } from "@handsontable/react";
import "handsontable/dist/handsontable.min.css";
import corpPeopleDataTitle from "../src/data.js";

const demoData = Handsontable.helper.createSpreadsheetData(10, 10);

const secondColumnSettings = {
  title: "Second column header",
  readOnly: true
};

const columnTitle = [
  ...corpPeopleDataTitle
];

function App() {

  console.log(columnTitle);

  return (
    <div className="app-container">
      <h2>M&A Data Demo</h2>
      <HotTable data={demoData} licenseKey="non-commercial-and-evaluation">
        <HotColumn title="First column header" />
        <HotColumn settings={secondColumnSettings} />
      </HotTable>
    </div>
  );
}

export default App;
